import { Routes, Route } from "react-router-dom";
import HomePage from "./HomePage";
import BookingPage from "./BookingPage";
import './App.css';

function App() {
  return (
    // <>
    //   <Header />
    //   <Main />
    //   <Footer />
    // </>
    <Routes>
    <Route path="/" element={<HomePage />}></Route>
    <Route path="/booking" element={<BookingPage />}></Route>
    </Routes>
  );
}

export default App;
